import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';

import Video from './video';
import Header from './header';

const header= ReactDOM.createRoot(document.querySelector('header'));
header.render(
  <>
    <Header />
  </>
);

const article= ReactDOM.createRoot(document.querySelector('article'));
article.render(
  <>
    <Article />
  </>
);

// const main= ReactDOM.createRoot(document.querySelector('main'));
// main.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>
// );
const video= ReactDOM.createRoot(document.querySelector('vidos'));
video.render(
  <>
    <Video />
  </>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
